import React from 'react';

function Card(props) {
    return (

        <div className="person">
            <h1>{props.name}</h1>
            <p>{props.age}</p>
        </div>
    );
}

ReactDOM.render(<Card name="Alex" age="25" />,
document.querySelector("#app"));
